def GN(x, w, b, g, e=1e-5):
 C,H,Wd=x.shape
 xg=x.reshape(g,C//g,H,Wd)
 m=xg.mean(axis=(1,2,3), keepdims=True)
 v=xg.var(axis=(1,2,3), keepdims=True)
 xhat=(xg - m) / np.sqrt(v + e)
